import React, { useState } from 'react';
import './StudentDashboard.css'; // Add a CSS file for styling

const StudentDashboard = () => {
  // Student details (can be fetched dynamically later)
  const studentInfo = {
    name: "Jane Smith",
    dob: "August 10, 2002",
    year: "Final Year",
    department: "Computer Engineering",
    contact: "jane.smith@student.edu",
    resume: "/resumes/jane_smith_resume.pdf", // Link to student's resume
  };

  // Example alerts for the student (can be fetched dynamically)
  const alerts = [
    "Company Drive: ABC Technologies on October 25, 2024",
    "Midterm Exams starting from November 2, 2024",
    "Coding Competition: Hackathon on November 10, 2024",
  ];

  // State to store rating info
  const [professorRating, setProfessorRating] = useState({
    professorName: '',
    rating: 0,
    comment: ''
  });

  // Handle rating submission
  const handleRatingSubmit = (e) => {
    e.preventDefault();
    // You can send this data to the backend for storing ratings
    alert(`Rating submitted for ${professorRating.professorName}: ${professorRating.rating} stars. Comment: ${professorRating.comment}`);
  };

  return (
    <div className="dashboard-container">
      <h2>Student Dashboard</h2>

      {/* Student Personal Information */}
      <div className="student-info">
        <h3>Personal Details</h3>
        <p><strong>Name:</strong> {studentInfo.name}</p>
        <p><strong>Date of Birth:</strong> {studentInfo.dob}</p>
        <p><strong>Year:</strong> {studentInfo.year}</p>
        <p><strong>Department:</strong> {studentInfo.department}</p>
        <p><strong>Contact:</strong> {studentInfo.contact}</p>
        <a href={studentInfo.resume} target="_blank" rel="noopener noreferrer" className="resume-link">View Resume</a>
      </div>

      {/* Alerts Section */}
      <div className="alerts-section">
        <h3>Upcoming Alerts</h3>
        <ul>
          {alerts.map((alert, index) => (
            <li key={index}>{alert}</li>
          ))}
        </ul>
      </div>

      {/* Professor Rating Section */}
      <div className="rating-section">
        <h3>Rate Your Professors</h3>
        <form onSubmit={handleRatingSubmit} className="rating-form">
          <label htmlFor="professor-name">Professor Name:</label>
          <input
            type="text"
            id="professor-name"
            value={professorRating.professorName}
            onChange={(e) => setProfessorRating({ ...professorRating, professorName: e.target.value })}
            required
          />
          
          <label htmlFor="rating">Rating:</label>
          <div className="star-rating">
            {[...Array(5)].map((star, index) => (
              <span
                key={index}
                className={`star ${index < professorRating.rating ? "selected" : ""}`}
                onClick={() => setProfessorRating({ ...professorRating, rating: index + 1 })}
              >
                &#9733;
              </span>
            ))}
          </div>
          
          <label htmlFor="comment">Comment:</label>
          <textarea
            id="comment"
            value={professorRating.comment}
            onChange={(e) => setProfessorRating({ ...professorRating, comment: e.target.value })}
            required
          ></textarea>

          <button type="submit" className="submit-btn">Submit Rating</button>
        </form>
      </div>
    </div>
  );
};

export default StudentDashboard;
